import './App.css'

import ServerBar from './componets/ServerBar';
import Friends from './componets/Friends';
import Header from './componets/Header';
import Chat from './componets/Chat';

function App() {
  return (
    <div className="App">
      <ServerBar/>
      <div>
        <Header/>
        <Friends/>
        <Chat/>
      </div>
    </div>
  );
}

export default App;
